import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const LocationHeader = () => {
    return (
        <View style={styles.location_Header}>
            <View>
                <Text>Left</Text>
                <Text>Middle</Text>
                <Text>Right</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({})

export default LocationHeader;
